    return (
        <>
            <div className="container py-5">
                <div className="row justify-content-center">
                    <div className="col-12">
                        <h2 className="row justify-content-center">Resume</h2>
                        <hr></hr>
                    </div>
                </div>
            </div>
            <div className="container py-5 h-100 mb-3" >
                <div className="row justify-content-center">
                    <div className="col-12">
                        
                     
                    </div>
                </div>
            </div>
            
        </>
    );
}

export default Resume;
